import "./App.css"
import React from "react";
import {useEffect, useState} from "react";
import axios from "axios";
import TextField from '@mui/material/TextField';


const viewUser = ({user}) => {
    return (
        <div>
            <td>{user.username}</td>
            <td>{user.email}</td>
            <td>{user.organization}</td>
            <td>{user.address}</td>
            <td>{user.city}</td>
            <td>{user.state}</td>
            <td>{user.country}</td>
            <td>{user.postalcode}</td>
        </div>
    )
};


const UserList = ({users}) => {
    const [selectedUserId, setSelectedUserId] = useState(null); //usestate [] where it's objects?
    const [isVisible, setIsVisible] = useState(false);

    const handleUserClick = (id) => {
        if (selectedUserId && selectedUserId === id){
            setSelectedUserId(null);
            setIsVisible(false);
        }
        else{
            setSelectedUserId(id);
            setIsVisible(true);
        }
        console.log(selectedUserId);
        console.log(id);
        console.log(isVisible);
    };

    //.id or .username?
    return(
        <div>
        <table>
        <thead>
            <tr>
                <th scope="col">Username:</th>
                <th scope="col">Email:</th>
                <th scope="col">Organization:</th>
                <th scope="col">Address:</th>
                <th scope="col">City:</th>
                <th scope="col">State:</th>
                <th scope="col">Country:</th>
                <th scope="col">Postal Code:</th>
                <th scope="col">Edit:</th>
            </tr>
        </thead>
        <tbody>
        </tbody>

            {users.map((user) => (
                <tr>
                    {(this.state.isVisible) ? <viewUser user={user}/> : <p></p>}
                    <td onClick={() => {handleUserClick(user.id);}}>Edit {user.username} data</td>
                </tr>
            ))}
        </table>
        </div>
    );

};

//view side:onclick, hide view & go to userdetails
//edit side: onclick, hide edit (+ update data) & go to view

//<tr> {(!this.state.edit) ? <tabledisplay {user} /> : <userdisplay />}


const App = () => {
    const [users, setUsers] = useState([]);
    const [isLoading, setIsLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchUsers = async() => {
            try{
                const response = await fetch("http://127.0.0.1:5000/userlist");

                if (!response.ok) {
                    throw new Error('failed to fetch users');
                }
                const data = await response.json();
                console.log(data);
                setUsers(data);
            } catch (err) {
                setError(err.message);
            } finally {
                setIsLoading(false);
            }
        };

        fetchUsers();
    }, []);


    if (isLoading) return <p>Loading...</p>
    if (error) return <p>Error: {error}</p>;

    return <UserList users={users}/>;
};

export default App;
